"use strict";Vue.component("search-select-more",{props:{init:{require:!1},more:{type:Boolean,require:!1,default:function(){return!0}},options:{type:Object,default:function(){return[{code:"New York",name:"New York"}]}}},data:function(){return{selectMore:[],select:""}},methods:{selectMul:function(){this.more?this.$emit("input",this.selectMore):this.$emit("input",this.select)}},mounted:function(){this.more?this.selectMore=this.init:this.select=this.init},template:'<div>\n        <div v-if="more">\n            <i-select v-model="selectMore" v-on:on-change="selectMul()" filterable multiple>\n               <i-option v-for="item in options" :value="item.code" :key="item.value">{{ item.name }}</i-option>\n            </i-select>\n        </div>\n        <div v-if="!more">\n        <i-select v-model="select" v-on:on-change="selectMul()">\n           <i-option v-for="item in options" :value="item.code" :key="item.value">{{ item.name }}</i-option>\n        </i-select>\n        </div>\n</div> '});